publish.value:
{{ 
    [
        ticket_type.id for ticket_type in TASKS.kaseya_bms_get_tenant_lookup_table_content.result.result
        if (ticket_type.name == "NOC")
        or (ticket_type.name == "Service Request")
        or ("service request" in ticket_type.name | lower )
    ] | first
 }}

{{ 
    [
        location.id for location in TASKS.kaseya_bms_list_locations_by_account.result.result
        if location.isMain == true
    ] | first
 }}

{{ 
    [
        status.id for status in TASKS.kaseya_bms_list_statuses.result.result
        if status.name == "New" or status.name == "New*" or status.name == "*New*"
    ] | first
 }}

{{ 
    [
        ticket_source.id for ticket_source in TASKS.kaseya_list_sources.result.result
        if ticket_source.name == "Other"
    ] | first
 }}

{{ 
    [
        role_type.id for role_type in TASKS.kaseya_bms_list_roles.result.result
        if role_type.isDefault == true
    ] | first
 }}

{{ 
    [
        ticket.id for ticket in TASKS.kaseya_bms_list_tickets.result.result
        if ticket.ticketNumber == CTX.kaseya_ticket_number
    ] | first
 }}

{{ 
    [
        work_type.id for work_type in TASKS.kaseya_bms_list_work_types.result.result
        if work_type.isDefault == true
    ] | first
 }}

{{
    [
        ticket_note_type.id for ticket_note_type in TASKS.list_ticket_note_type.result.result
        if ticket_note_type.name == "General Note" or ticket_note_type.name == "General Notes"
    ] | first
 }}

